import { Component } from "react";
import logo from "../../VisualizarCitas/components/card/morado.png";
import "../css/CitasContainer.css"

export class CitasContainer extends Component {
    render() {
        const { datosBienvenida } = this.props;
        return (
                <>
            <div class="seccionRedondeada" >
                <div class="container">
                    <img class="circulo rounded-circle" src={logo}/>
                </div>
                <div class="nombreSeccion">{datosBienvenida.nombre}</div>
                <div class = "horarioSeccion">{datosBienvenida.horario}</div>
            </div>
        </>
        );
    }
}

export default CitasContainer;
